package mx.jresendiz.training.hackerrank.MakingAnagrams

import spock.lang.Specification

class MakingAnagramsSpec extends Specification {
    void "Should verify the anagram problem"() {
        expect:
        MakingAnagrams.numberNeeded(word1, word2) == result
        where:

        word1 | word2 || result
        "cde" | "abc" || 4
        "sample" | "amp" || 3
        "" | "" || 732
    }
}
